/* tslint:disable */
/* eslint-disable */
/**
*/
export class Series {
  free(): void;
/**
* @param {string} name
* @param {any[]} values
*/
  constructor(name: string, values: any[]);
/**
* @param {boolean} in_place
* @returns {Series | undefined}
*/
  rechunk(in_place: boolean): Series | undefined;
/**
* @param {Series} other
* @returns {Series}
*/
  bitand(other: Series): Series;
/**
* @param {Series} other
* @returns {Series}
*/
  bitor(other: Series): Series;
/**
* @param {boolean} reverse
* @returns {Series}
*/
  cum_sum(reverse: boolean): Series;
/**
* @param {boolean} reverse
* @returns {Series}
*/
  cum_max(reverse: boolean): Series;
/**
* @param {boolean} reverse
* @returns {Series}
*/
  cum_min(reverse: boolean): Series;
/**
* @returns {Uint32Array}
*/
  chunk_lengths(): Uint32Array;
/**
* @returns {string}
*/
  name(): string;
/**
* @param {string} name
*/
  rename(name: string): void;
/**
* @returns {number | undefined}
*/
  mean(): number | undefined;
/**
* @returns {number}
*/
  n_chunks(): number;
/**
* @param {number} num_elements
* @returns {Series}
*/
  limit(num_elements: number): Series;
}
